import { FaTrashAlt } from "react-icons/fa";
import "./HistoryTableRow.css";

const HistoryTableRow = ({ product, qty }) => {
  // Render component
  return (
    <div className="row history-table__row">
      <h6 className="col-2 d-none d-lg-block">ID ORDER</h6>
      <h6 className="col-2 d-none d-lg-block">ID USER</h6>
      <h6 className="col-3 col-md-2">NAME</h6>
      <h6 className="col-2 col-lg-1 d-none d-md-block">PHONE</h6>
      <h6 className="col-3 col-lg-1 col-md-2">ADDRESS</h6>
      <h6 className="col-3 col-md-1">TOTAL</h6>
      <h6 className="col-2 col-lg-1 d-none d-md-block">DELIVERY</h6>
      <h6 className="col-1 d-none d-md-block">STATUS</h6>
      <h6 className="col-3 col-lg-1 col-md-2">
        <button className="history-remove-btn">
          <FaTrashAlt />
        </button>
      </h6>
    </div>
  );
};

export default HistoryTableRow;
